import 'bootstrap/dist/js/bootstrap.min.js'; 
import Footer from '../../Component/Footer'

function ServiceApp() {
  return (
    <div className="App">
       <Banner/>
       <Services/> 
       <Footer/>

    </div>



  );
}


export default ServiceApp;
